import React from 'react';

import './App.css';
import "./sidebar.css";
import SideBar from "./sidebar";
import logo from './assets/fusion_logo.png';

function Welcome(props) {
    return <h1>Hello, {props.name}</h1>;
}


function App() {
    return (
        <div id="App">
            <SideBar pageWrapId={"page-wrap"} outerContainerId={"App"} />

            <div id="page-wrap"><img src={logo} className="App-logo" alt="logo" /> <h1>conFUSION</h1> </div>
      

        <Welcome name="Sara" />
        <Welcome name="Cahal" />
        <Welcome name="Edite" />






        </div>
);
}




export default App;
